import React from "react";
import "./Home.css";

const Home = () => {
  // 기능 로직 구현
  return (
    <div class="Home" id="home">
      <div class="typer-text">
        Front-End Developer 고윤혁의 포트폴리오입니다.
      </div>
    </div>
  );
};

export default Home;
